    return (
      <article class="vh-100 dt w-100 bg-dark-pink">
        <div class="dtc v-mid tc white ph3 ph4-l">
          <h1 class="f6 f2-m f-subheadline-l fw6 tc">
            Vertically centering things in css is easy!
          </h1>
        </div>
      </article>
    );
  }
}

export default Layout;
